package com.MITProject.TravelerHelperBot.botController;import com.MITProject.TravelerHelperBot.botService.TelegramWebHooksService;import lombok.RequiredArgsConstructor;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.web.bind.annotation.PostMapping;import org.springframework.web.bind.annotation.RequestBody;import org.springframework.web.bind.annotation.RequestMapping;import org.springframework.web.bind.annotation.RestController;import org.telegram.telegrambots.meta.api.methods.BotApiMethod;import org.telegram.telegrambots.meta.api.objects.Update;@RestController@RequestMapping("app/telegram")public class TelegramBotController {    @Autowired    private TelegramWebHooksService telegramWebHookService;    @PostMapping("/message")    public BotApiMethod<?> message(@RequestBody Update update){        System.out.println(update);        System.out.println("bot called------------------------------------------------------------------------------");        return telegramWebHookService.onWebhookUpdateReceived(update);    }}